                display: flex;
                flex-direction: column;
                align-items: flex-start;
                justify-content: space-between;
            }

            .fishFeed__wrapper>div:last-child {
                display: flex;
                flex-direction: column;
                align-items: flex-end;
            }


            .fishFeed__p {
                font-size: 18px;
                color: var(--black, #00222A);
                line-height: 150%;

            }

            .fishFeed__p-b {
                max-width: 479px;
                font-size: 28px;
                font-weight: 700;
                line-height: 140%;
            }

            .fishFeed__img1 {
                max-width: 730px;
                max-height: 499px;
            }

            .fishFeed__img2 {
                max-width: 514px;
                max-height: 484px;
                margin-bottom: 80px;
            }

            .block-first__parag-b {
                font-size: 24px;
                font-weight: 700;
                line-height: 140%;
                max-width: 600px;
            }

            .block-first__flex {
                display: flex;
                align-items: flex-start;
                gap: 40px;
            }

            .block-first__parag {
                color: var(--black, #00222A);
                font-family: Calibri;
                font-size: 18px;
                padding: 40px;
                margin-bottom: 0 !important;
            }

            .block-first__svg {
                position: absolute;
                right: 10px;
                bottom: 10px;
            }

            .block-first__box {
                border-radius: 16px;
                border: 2px solid var(--primary, #052D5E);
                display: flex;
                align-items: flex-end;
                position: relative;
            }

            .container.fishFeed__wrapper .block-first {
                gap: 35px;
            }

            .block-first__banner-fishFeed {
                max-width: 510px;
                width: 100%;
                border-radius: 16px;
                max-height: 361px;
            }

            @media screen and (max-width: 1400px) {

                .fishFeed__img1,
