                    max-width: 500px;
                    max-height: 499px;
                }

                .block-first__parag {
                    padding-right: 60px;
                }

            }

            @media screen and (max-width: 1100px) {

                .fishFeed__img1,
                .fishFeed__img2 {
                    max-width: 400px;
                    max-height: 400px;
                    width: -webkit-fill-available;
                }

            }

            @media (max-width: 950px) {
                .fishFeed__wrapper {
                    gap: 24px;
                    flex-direction: column;
                }

                .fishFeed__p-b {
                    font-size: 24px;
                }

                .fishFeed__wrapper>div:first-child {
                    flex-direction: column;
                    gap: 24px;
                }

                .fishFeed__wrapper>div:last-child {
                    display: flex;
                    flex-direction: column-reverse;
                    align-items: stretch;
                    gap: 24px;
                }

                .block-first__parag {
                    padding: 24px;
                    padding-right: 60px;
                }

                .block-first__flex {
                    gap: 24px;
                    flex-direction: column;
                }
            }

            @media (max-width: 650px) {
                .fishFeed__img2 {
                    margin-bottom: 0;
                }
            }
